import './App.css';
import { Route, Routes, Router } from 'react-router-dom'
import Header from './component/Header'
import About from './page/About'
import Users from './page/User'

function App() {
  return (
    <Router>
      <div className="App">
          <h1>hi</h1>
          <Header/>
      </div>
      <Routes>
        <Route path="/" element={<App />} exact/>
        <Route path="/about" element={<About />} component = {About}/>
        <Route path="/users/:userId" element={<Users />} component={Users} />
      </Routes>
    </Router>
  );
}

export default App;
